export default class ZoneScreen extends React.Component {
  static navigationOptions = {
    title : "Zone"
  };
  constructor(props) {
    super(props);
    this.state = {
      zoneDataList: props.zoneDataList || data,
      openAddZoneDialog: props.openAddZoneDialog
    };

    let zoneList = this.state.zoneDataList;
    console.log('zoneList constructor', zoneList.length);
  }
  static getDerivedStateFromProps(nextProps, prevState) {
    return null;
    
  }

  componentDidMount() {
    console.log('openAddZoneDialog', this.state.openAddZoneDialog);
    console.log('ZoneScreen componentDidMount');
  }
  shouldComponentUpdate(nextProps, nextState) {
    console.log('ZoneScreen shouldComponentUpdate');
    return true;
  }
  getSnapshotBeforeUpdate(prevProps, prevState) {
    console.log('ZoneScreen getSnapshotBeforeUpdate');
    return null;
  }
  componentDidUpdate(prevProps, prevState, snapshot) {
    console.log('ZoneScreen componentDidUpdate');
  }
  componentWillUnmount() {
    console.log('ZoneScreen componentWillUnmount');
  }

  showDialog = (flag) => {
    console.log('showDialog', flag);
    this.props.toggleAddZoneDialog(flag);
    this.setState({openAddZoneDialog: flag});
  };

  showDevice = (data) => {
    // console.log('showDevice', data);
    this.props.navigation.navigate('ZoneDevices', { deviceData : data});
  };

  onAddData = (data) => {
    console.log('onAddData', data);
    let zoneList = this.state.zoneDataList;
    zoneList = [...zoneList, data];
    this.showDialog(false);
    console.log('zoneList', zoneList.length);
    this.setState({zoneDataList: zoneList});
    this.showDevice(data);
  };

  render() {
    return (
      <View style={styles.container}>
        <HeaderApp uri="https://image.freepik.com/free-icon/male-user-shadow_318-34042.jpg" />
        <View style={styles.contentContainer}>
          <ZoneListContainer onShowDialog={this.showDialog} onPressData={this.showDevice} zoneDataList={this.state.zoneDataList} />
          <ZoneAddContainer showAddZoneDialog={this.state.openAddZoneDialog} onAddData={this.onAddData} onShowDialog={this.showDialog} />
        </View>
      </View>
    );
  }



 
}

